SPA forms handling with Dataform Javascript - Not leaving form info in URL<p>I am working with express, mongoose and JavaScript to create a single page application. The code works , except <strong>I dont want to keep form info in the URL with post request.</strong> I tried redirect but it kind ended in loop - I think.</p>
<p>I am not using form method=&quot;post&quot; because it will redirect the page and this is a SPA.
I would like not to show this or redirect from the URL to the same page without the query info.</p>
<blockquote>
<p>http://localhost:2000/<em>?firstName=John&amp;lastName=James&amp;age=40</em></p>
</blockquote>
<p>This is the form (index.html) --</p>
<pre><code>&lt;form id=&quot;formId&quot;&gt;
      &lt;input type=&quot;text&quot; name=&quot;firstName&quot;&gt;
      &lt;input type=&quot;text&quot; name=&quot;lastName&quot;&gt;
      &lt;input type=&quot;text&quot; name=&quot;age&quot;&gt;
      &lt;button type=&quot;submit&quot; onclick=&quot;processForm(event)&quot;&gt;Save&lt;/button&gt;
&lt;/form&gt;
</code></pre>
<p>Here is the  JS for the form handling :</p>
<pre><code>function processForm(event){
  var formData = new FormData(document.forms[0])
  const queryString = Object.fromEntries(
    Array.from(formData.keys()).map(key =&gt; [
    key, formData.getAll(key).length &gt; 1 ?
    formData.getAll(key) : formData.get(key)]));
  postData(queryString);   
}

async function postData(data) {
  fetch('/people', {
    method: 'POST', 
    headers: {'Content-Type': 'application/json'},
    body: JSON.stringify(data),
  })
  .then(response =&gt;response.json())
  .then(data =&gt; console.log('Success:', data))
  .catch((error) =&gt; {
  console.error('Error:', error);
  });
};
</code></pre>

