         98,   1, 166,  72,  24,
        154, 249, 160, 106, 199,
         92, 161
      ]
    }
  }
}
</code></pre>
<p>I have well-founded suspicions that the problem arises because in my Todo Schema, I have a field 'owner' which gets populated with the client's _id from MongoDB (the client that sent the request to create the new todo):</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');

const TodoSchema = new mongoose.Schema({

    _id: {
        type: mongoose.Types.ObjectId,
        default: mongoose.Types.ObjectId()
    },
    owner: {
        type: mongoose.Types.ObjectId,
        ref: 'User'
    },
    title: {
        type: String,
        required: true
    },
    description: {
        type: String, 
        required: true
    },
    isCompleted: {
        type: Boolean, 
        required: true
    }

});

module.exports = mongoose.model('Todo', TodoSchema);
</code></pre>
<p>Now, this is how the server is handling the request:</p>
<pre class="lang-js prettyprint-override"><code>// Create Todo
router.post('/createTodo', async (req, res) =&gt; {
    const { ownerName, title, description, isCompleted } = req.body;

    if(!title || !description || isCompleted === null || ownerName === null) return res.status(400).send();

    const owner = await User.findOne({ username: ownerName }).exec();

    const existingTodo = await Todo.findOne({ owner: owner._id, title: title }).exec();

    if(existingTodo) return res.status(409).send();

    try {
        const todo = new Todo({
            owner: owner._id,
            title, 
            description,
            isCompleted
        })

        todo.save();
        res.status(200).send();

    } catch (error) {
        console.error(`ERROR: ${error}`);
        res.status(409).end();
    }
});
</code></pre>
<p>I'd like to add that I've noticed that once I log in, I can successfully create a new todo, but if I try to create another one within the same session, it throws that error, but if the session expires and I log in again, then I can create another new todo; just one todo per session.</p>

